import axios from 'axios';
import { FETCH_USER } from './types';


export const fetchUser = () => async dispatch => {
  const res = await axios.get('/api/current_user');
  console.log(res);
  dispatch({ type: FETCH_USER, payload: res.data });
};

// New Username and password
export const submitNewUser = (values, history) => {
  const response = axios.post('/api/users', values);
  console.log(response.values);
  //dispatch({ type: 'NEW_USER', payload: response.data });
  history.push('/');
};

export const findUser = (values, history) => async dispatch => {
  const res = axios.get('/api/users', values);

  //dispatch({ type: 'NEW_USER', payload: res.data });
  history.push('/');
}
